CREATE DEFINER=`root`@`localhost` PROCEDURE `approveDocument`(docId int, _approverId INT(11), approvalStatus tinyint(1), approverComment varchar(200))
BEGIN
	
    declare docStatus tinyint(1);
	declare _description varchar(200);
    
    declare docStatusText varchar(20);
    SET @approverName ="";
    
    IF approvalStatus = true THEN
        SET docStatus = 1;
        SET docStatusText = 'Approved';
	ELSE
		SET docStatus = 2;
        SET docStatusText = 'Rejected';
	END IF;
    
	UPDATE `lawyer_doc_store`.`documents` as d
	SET `isApproved` = docStatus,
		`approverComments` = approverComment,
        `approvalId` = _approverId,
        `approvedOn` = NOW()
    WHERE d.id = docId;
    
    INSERT INTO `lawyer_doc_store`.`approvalhistory`
	(`approverId`, `docId`)
	VALUES (approverId, docId);

	SELECT @approverName := UserName  from users where Id = _approverId;
    
    
 SET _description = CONCAT('Document with Id: ',
	docId,
	' has been ',
	docStatusText,
    ' by approver ', 
    @approverName,
    ' with approval comments: ',
    approverComment,
    ' On ',
    CAST(now() as CHAR));
    
    -- select _description;

    INSERT INTO history(description) VALUES(_description);
    
END ;;
DELIMITER ;
