CREATE DEFINER=`root`@`localhost` PROCEDURE `createNewDocument`(
	_firstNameOfExpert varchar(45), 
    _lastNameOfExpert varchar(45), 
    _practiceArea varchar(45),     
    _dateTaken date, 
    _pltdef varchar(45),
    _firstNameOfLawyer varchar(45), 
    _lastNameOfLawyer varchar(45), 
    _jurisdiction varchar(45), 
    _format varchar(45),
    _filePath varchar(200),
    _lawyerComments varchar(200),
    _tag1 varchar(50),
    _tag2 varchar(50),
    _tag3 varchar(50),
    _tag4 varchar(50),
    _tag5 varchar(50),
    caseTypeId int,
    submitter varchar(100),
    submitterId int,
    fileNameTitle varchar(100),
	_suffix varchar(45))
BEGIN

	declare docId int;
    declare _description varchar(200);
    
    
	INSERT INTO `lawyer_doc_store`.`documents`
	(`firstNameOfExpert`,
	`lastNameOfExpert`,
	`practiceArea`,
	`dateTaken`,
	`plt/def`,
	`firstNameOfLawyer`,
	`lastNameOfLawyer`,
	`jurisdiction`,
    `filePath`,
	`format`,
    `isApproved`,
    `lawyerComments`,
    `caseTypeId`,
    `submitterId`,
    `fileNameTitle`,
    `suffix`,
    `submitter`)
	VALUES
	(
	_firstNameOfExpert,
	_lastNameOfExpert,
	_practiceArea, 
	_dateTaken,
	_pltdef,
	_firstNameOfLawyer,
	_lastNameOfLawyer,
	_jurisdiction,
    _filePath,
	_format,
    0,
    _lawyerComments,
    caseTypeId,
    submitterId,
    fileNameTitle,
    _suffix,
    submitter);	    
    
    SELECT MAX(id) INTO docId FROM documents;
    
    INSERT INTO `lawyer_doc_store`.`tags` (`docId`, `tag1`, `tag2`, `tag3`, `tag4`, `tag5`)
	VALUES (docId, _tag1,_tag2,_tag3,_tag4,_tag5);
    
  
    SET _description = CONCAT('New document has been uploaded by expert ', 
    submitter,
    '. Lawyer: ',
    _lastNameOfLawyer,
    ', ',
    _firstNameOfLawyer,
    ', Jurisdiction: ',
    _jurisdiction,
    ', DateTaken: ',
    CAST(_dateTaken as CHAR),
    ', Practice Area: ',
    _practiceArea,
    ' On ',
    CAST(now() as CHAR));
    

    INSERT INTO history(description) VALUES(_description);

END ;;
DELIMITER ;
