DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `getAllDocuments`(docStatus int, userId int)
BEGIN
	
    IF docStatus = 1 THEN
		SELECT d.`id`,
		d.`firstNameOfExpert` as `Expert_FName`,
		d.`lastNameOfExpert` as `Expert_LName`,
		d.`dateTaken`,
		CASE WHEN d.`lastNameOfLawyer` <> '' and d.`lastNameOfLawyer` <> '' THEN
				concat(d.`plt/def`, ' (', d.`lastNameOfLawyer`,' ', d.`firstNameOfLawyer`, ')')
                ELSE
					d.`plt/def`
            END `plt/def`,
		d.`firstNameOfLawyer` as `Lawyer_FName`,
		d.`lastNameOfLawyer` as `Lawyer_LName`,
		d.`jurisdiction`,
        d.`practiceArea`,
		d.`format`,
		CASE 	WHEN d.`isApproved` = 0 THEN 'Pending'
				WHEN d.`isApproved` = 1 THEN 'Approved'
				WHEN d.`isApproved` = 2 THEN 'Rejected'
		END `status`,
		c.caseType,    
		d.`lawyerComments` as `lawyerComments`,
		d.`approverComments` as `approverComments`,
		u.UserName as `approver`,
		d.`approvedOn` as `approvedOn`,
        d.`suffix`,
		t.`tag1`,
		t.`tag2`,
		t.`tag3`,
		t.`tag4`,
		t.`tag5`,
        f.format,        
        f.depositionFileTitle,
        CASE WHEN f.supportingFile <> "" THEN TRUE ELSE FALSE END 'isSupportingFilePresent'
		FROM documents as d
		LEFT JOIN users as u
		ON d.approvalId = u.id
		LEFT JOIN tags as t
		ON d.id = t.docId
		LEFT JOIN casetypes c
		ON d.caseTypeId = c.id
        LEFT JOIN files as f
        ON f.docId = d.id
        WHERE d.isApproved = 1 OR (d.submitterId = userId AND d.isApproved IN (0,1,2))
        order by d.isApproved, d.`lastNameOfExpert` asc;
	ELSE
		IF docStatus = -1 THEN        
			SELECT d.`id`,
			d.`firstNameOfExpert` as `Expert_FName`,
			d.`lastNameOfExpert` as `Expert_LName`,
			d.`dateTaken`,
			CASE WHEN d.`lastNameOfLawyer` <> '' and d.`lastNameOfLawyer` <> '' THEN
				concat(d.`plt/def`, ' (', d.`lastNameOfLawyer`,' ', d.`firstNameOfLawyer`, ')')
                ELSE
					d.`plt/def`
            END `plt/def`,
			d.`firstNameOfLawyer` as `Lawyer_FName`,
			d.`lastNameOfLawyer` as `Lawyer_LName`,
			d.`jurisdiction`,
            d.`practiceArea`,
			d.`format`,
            d.`suffix`,
			CASE 	WHEN d.`isApproved` = 0 THEN 'Pending'
					WHEN d.`isApproved` = 1 THEN 'Approved'
					WHEN d.`isApproved` = 2 THEN 'Rejected'
			END `status`,
			c.caseType,    
			d.`lawyerComments` as `lawyerComments`,
			d.`approverComments` as `approverComments`,
			u.UserName as `approver`,
			d.`approvedOn` as `approvedOn`,
			t.`tag1`,
			t.`tag2`,
			t.`tag3`,
			t.`tag4`,
			t.`tag5`,
			f.format,        
			f.depositionFileTitle,
			CASE WHEN f.supportingFile <> "" THEN TRUE ELSE FALSE END 'isSupportingFilePresent'
			FROM documents as d
			LEFT JOIN users as u
			ON d.approvalId = u.id
			LEFT JOIN tags as t
			ON d.id = t.docId
			LEFT JOIN casetypes c
			ON d.caseTypeId = c.id
			LEFT JOIN files as f
			ON f.docId = d.id
            WHERE d.isApproved = 2
            order by d.isApproved, d.`lastNameOfExpert` asc;
        ELSE
        SELECT d.`id`,
			d.`firstNameOfExpert` as `Expert_FName`,
			d.`lastNameOfExpert` as `Expert_LName`,
			d.`dateTaken`,
            CASE WHEN d.`lastNameOfLawyer` <> '' and d.`lastNameOfLawyer` <> '' THEN
				concat(d.`plt/def`, ' (', d.`lastNameOfLawyer`,' ', d.`firstNameOfLawyer`, ')')
                ELSE
					d.`plt/def`
            END `plt/def`,
			d.`firstNameOfLawyer` as `Lawyer_FName`,
			d.`lastNameOfLawyer` as `Lawyer_LName`,
			d.`jurisdiction`,
            d.`practiceArea`,
			d.`format`,
            d.`suffix`,
			CASE 	WHEN d.`isApproved` = 0 THEN 'Pending'
					WHEN d.`isApproved` = 1 THEN 'Approved'
					WHEN d.`isApproved` = 2 THEN 'Rejected'
			END `status`,
			c.caseType,    
			d.`lawyerComments` as `lawyerComments`,
			d.`approverComments` as `approverComments`,
			u.UserName as `approver`,
			d.`approvedOn` as `approvedOn`,
			t.`tag1`,
			t.`tag2`,
			t.`tag3`,
			t.`tag4`,
			t.`tag5`,
			f.format,        
			f.depositionFileTitle,
			CASE WHEN f.supportingFile <> "" THEN TRUE ELSE FALSE END 'isSupportingFilePresent'
			FROM documents as d
			LEFT JOIN users as u
			ON d.approvalId = u.id
			LEFT JOIN tags as t
			ON d.id = t.docId
			LEFT JOIN casetypes c
			ON d.caseTypeId = c.id
			LEFT JOIN files as f
			ON f.docId = d.id
			WHERE d.isApproved IN (0,1)
            order by d.isApproved, d.`lastNameOfExpert` asc;
        END IF;    
    END IF;
END ;;
DELIMITER ;
