CREATE DEFINER=`root`@`localhost` PROCEDURE `searchDocumentsByTags`(docStatus int, tag1 VARCHAR(45),tag2 VARCHAR(45),tag3 VARCHAR(45),tag4 VARCHAR(45),tag5 VARCHAR(45))
BEGIN

IF docStatus = 1 THEN
	SELECT d.`id`,
    d.`firstNameOfExpert` as `Expert_FName`,
    d.`lastNameOfExpert` as `Expert_LName`,
    d.`dateTaken`,
    CASE WHEN d.`lastNameOfLawyer` <> '' and d.`lastNameOfLawyer` <> '' THEN
				concat(d.`plt/def`, ' (', d.`lastNameOfLawyer`,' ', d.`firstNameOfLawyer`, ')')
                ELSE
					d.`plt/def`
            END `plt/def`,
    d.`firstNameOfLawyer` as `Lawyer_FName`,
    d.`lastNameOfLawyer` as `Lawyer_LName`,
    d.`jurisdiction`,
	d.`practiceArea`,
    d.`format`,
    d.`suffix`,
	    CASE 	WHEN d.`isApproved` = 0 THEN 'Pending'
			WHEN d.`isApproved` = 1 THEN 'Approved'
            WHEN d.`isApproved` = 2 THEN 'Rejected'
	END `status`,
    c.casetype, 
    d.`lawyerComments` as `lawyerComments`,
    d.`approverComments` as `approverComments`,
    u.UserName as `approver`,
    d.`approvedOn` as `approvedOn`,
    t.`tag1`,
    t.`tag2`,
    t.`tag3`,
    t.`tag4`,
    t.`tag5`
    FROM `lawyer_doc_store`.`documents` as d
    LEFT JOIN users as u
    ON d.approvalId = u.id
    INNER JOIN `lawyer_doc_store`.`tags` as t
    ON d.id = t.docId
	LEFT JOIN casetypes c
    ON d.castypeId = c.id
    WHERE d.isApproved = 1 AND d.id
    IN ( 	SELECT docId
			FROM `lawyer_doc_store`.`tags` as t
            WHERE 	(tag1 IN (t.tag1, t.tag2, t.tag3, t.tag4, t.tag5)) ||
					(tag2 IN (t.tag1, t.tag2, t.tag3, t.tag4, t.tag5)) ||
                    (tag3 IN (t.tag1, t.tag2, t.tag3, t.tag4, t.tag5)) ||
                    (tag4 IN (t.tag1, t.tag2, t.tag3, t.tag4, t.tag5)) ||
                    (tag5 IN (t.tag1, t.tag2, t.tag3, t.tag4, t.tag5)))
	order by d.isApproved, d.`lastNameOfExpert` asc;
	ELSE
		SELECT d.`id`,
    d.`firstNameOfExpert` as `Expert_FName`,
    d.`lastNameOfExpert` as `Expert_LName`,
    d.`dateTaken`,
    CASE WHEN d.`lastNameOfLawyer` <> '' and d.`lastNameOfLawyer` <> '' THEN
				concat(d.`plt/def`, ' (', d.`lastNameOfLawyer`,' ', d.`firstNameOfLawyer`, ')')
                ELSE
					d.`plt/def`
            END `plt/def`,
    d.`firstNameOfLawyer` as `Lawyer_FName`,
    d.`lastNameOfLawyer` as `Lawyer_LName`,
    d.`jurisdiction`,
    d.`practiceArea`,
    d.`format`,
    d.`suffix`,
	    CASE 	WHEN d.`isApproved` = 0 THEN 'Pending'
			WHEN d.`isApproved` = 1 THEN 'Approved'
            WHEN d.`isApproved` = 2 THEN 'Rejected'
	END `status`,
    c.casetype, 
    d.`lawyerComments` as `lawyerComments`,
    d.`approverComments` as `approverComments`,
    u.UserName as `approver`,
    d.`approvedOn` as `approvedOn`,
    t.`tag1`,
    t.`tag2`,
    t.`tag3`,
    t.`tag4`,
    t.`tag5`
    FROM `lawyer_doc_store`.`documents` as d
    LEFT JOIN users as u
    ON d.approvalId = u.id
    INNER JOIN `lawyer_doc_store`.`tags` as t
    ON d.id = t.docId
	LEFT JOIN casetypes c
    ON d.casetypeId = c.id
    WHERE d.isApproved IN (0,1) AND d.id
    IN ( 	SELECT docId
			FROM `lawyer_doc_store`.`tags` as t
            WHERE 	(tag1 IN (t.tag1, t.tag2, t.tag3, t.tag4, t.tag5)) ||
					(tag2 IN (t.tag1, t.tag2, t.tag3, t.tag4, t.tag5)) ||
                    (tag3 IN (t.tag1, t.tag2, t.tag3, t.tag4, t.tag5)) ||
                    (tag4 IN (t.tag1, t.tag2, t.tag3, t.tag4, t.tag5)) ||
                    (tag5 IN (t.tag1, t.tag2, t.tag3, t.tag4, t.tag5)))
	order by d.isApproved, d.`lastNameOfExpert` asc;
    END IF;
    
END ;;
DELIMITER ;
