CREATE DEFINER=`root`@`localhost` PROCEDURE `updateDocument`(
	_id int,
	_firstNameOfExpert varchar(45), 
    _lastNameOfExpert varchar(45), 
    _practiceArea varchar(45),     
    _dateTaken date, 
    _pltdef varchar(45),
    _firstNameOfLawyer varchar(45), 
    _lastNameOfLawyer varchar(45), 
    _jurisdiction varchar(45),	
    _lawyerComments varchar(200),
    _tag1 varchar(50),
    _tag2 varchar(50),
    _tag3 varchar(50),
    _tag4 varchar(50),
    _tag5 varchar(50),
    caseTypeId int,
    _submitter varchar(100),
    _submitterId int,
    _filePath varchar(200),
    _fileNameTitle varchar(100))
BEGIN

	declare docId int;
    declare _description varchar(200);
    
     UPDATE `lawyer_doc_store`.`tags`
    SET 
		tag1 = _tag1,
        tag2 = _tag2,
        tag3 = _tag3,
        tag4 = _tag4,
        tag5 = _tag5
	WHERE `lawyer_doc_store`.`tags`.docId = _id;
    
    IF _filePath = 'null' AND _fileNameTitle = 'null' THEN    
		UPDATE `lawyer_doc_store`.`documents`
		SET 
			firstNameOfExpert = _firstNameOfExpert,
			lastNameOfExpert=_lastNameOfExpert,
			practiceArea=_practiceArea,
			dateTaken=_dateTaken,
			`plt/def`=_pltdef,
			firstNameOfLawyer=_firstNameOfLawyer,
			lastNameOfLawyer=_lastNameOfLawyer,
			jurisdiction=_jurisdiction,        
			lawyerComments=_lawyerComments,
			caseTypeId=caseTypeId,
			submitterId=_submitterId,
            submitter = _submitter
		WHERE id = _id;
    ELSE
		UPDATE `lawyer_doc_store`.`documents`
		SET 
			firstNameOfExpert = _firstNameOfExpert,
			lastNameOfExpert=_lastNameOfExpert,
			practiceArea=_practiceArea,
			dateTaken=_dateTaken,
			`plt/def`=_pltdef,
			firstNameOfLawyer=_firstNameOfLawyer,
			lastNameOfLawyer=_lastNameOfLawyer,
			jurisdiction=_jurisdiction,        
			lawyerComments=_lawyerComments,
			caseTypeId=caseTypeId,
			submitterId=_submitterId,
			filePath = _filePath,
			fileNameTitle = _fileNameTitle
		WHERE id = _id;
    END IF;
    
   
	
   
   
  
    SET _description = CONCAT('Document has been modifed by expert ', 
    _submitter,
    '. Lawyer: ',
    _lastNameOfLawyer,
    ', ',
    _firstNameOfLawyer,
    ', Jurisdiction: ',
    _jurisdiction,
    ', DateTaken: ',
    CAST(_dateTaken as CHAR),
    ', Practice Area: ',
    _practiceArea,
    ' On ',
    CAST(now() as CHAR));
    

    INSERT INTO history(description) VALUES(_description);

END ;;
DELIMITER ;
