BEGIN
	
    IF EXISTS (select * from tags where docId = _docId) THEN
		UPDATE `lawyer_doc_store`.`tags`
		SET
		`tag1` = _tag1,
		`tag2` = _tag2,
		`tag3` = _tag3,
		`tag4` = _tag4,
		`tag5` = _tag5
		WHERE `docId` = _docId;
	ELSE 
		INSERT INTO `lawyer_doc_store`.`tags`(docId,tag1,tag2,tag3,tag4,tag5)
        VALUES(_docId, _tag1,_tag2,_tag3,_tag4,_tag5);
	END IF;

END ;;
