_lastName VARCHAR(100),
_address VARCHAR(100),
_address2 VARCHAR(100),
_city VARCHAR(100),
_state VARCHAR(100),
_postalCode VARCHAR(100),
_phone VARCHAR(45))
BEGIN

	Update users set UserName = _UserName, Password = _password where Id = _userId;
    
    IF EXISTS (select * from userdetails where userid = _userId) THEN
		UPDATE `lawyer_doc_store`.`userdetails`
		SET
		`firstName` = _firstName,
		`lastName` = _lastName,
		`address` = _address,
		`address2` = _address2,
		`city` =_city,
		`state` = _state,
		`postalCode` =_postalCode,
		`phone` = _phone
		WHERE `userid` = _userId;
	ELSE 
		INSERT INTO `lawyer_doc_store`.`userdetails`
		(`userid`,
		`firstName`,
		`lastName`,
		`address`,
		`address2`,
		`city`,
		`state`,
		`postalCode`,
		`phone`)
		VALUES
		(_userId,
		_firstName,
		_lastName,
		_address,
		_address2,
		_city,
		_state,
		_postalCode,
		_phone);
        
	END IF;

END ;;
